ive groups of data. Therefore, we are now able to see the different groups of data based on their corresponding sentiments."]},{"cell_type":"markdown","id":"7ce56c3b","metadata":{"papermill":{"duration":0.015968,"end_time":"2023-12-30T12:01:55.608644","exception":false,"start_time":"2023-12-30T12:01:55.592676","status":"completed"},"tags":[]},"source":["# Summary\n","- We went through our project of sentiment analysis in R. We learned about the concept of sentiment analysis and implemented it over the dataset of Jane Austen’s books. We were able to delineate it through various visualizations after we performed data wrangling on our data. We used a lexical analyzer – ‘bing’ in this instance of our project. Furthermore, we also represented the sentiment score through a plot and also made a visual report of wordcloud."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[],"dockerImageVersionId":30372,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":43.826278,"end_time":"2023-12-30T12:01:55.746238","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-12-30T12:01:11.91996","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}